import React from 'react'
import './footer.css'

const Footer = () => {
    return (
        <div className="gpt3__footer section__padding">
        <div className="gpt3__footer-heading">
          <h1 className="gradient__text">Do </h1>
         </div> 
        </div>
    )
}

export default Footer
